%%将速度离散化
for i=2:(S/h)
    x(:,i)=v_max:-d:v_min;
end
%%
%终端状态约束
v_last=v_max;
row_last=round((v_max-v_ref)/d)+1;%最后分离的速度有多少

for j=1:row_last
    if j == row_last
        x(j,column)=v_ref;
    end
end
%%
t_vubm=inf*ones(size(x));%与每个成本对比的无限大值
f_opt=nan*ones(size(x));%最优成本
x_opt=f_opt;%最优状态
z_opt=f_opt;%最优发动机on/off信号（离合器闭合/断开信号）
f_opt(:,column)=0;
% t_vubm(:,column)=0;
x_opt(:,column)=x(:,column);
%%
for i=1:row_last  %最后一列状态的最优档位为保持该速度下的最小燃油消耗率对应的档位
    p1=P1(x(i,column),x(i,column),a(column-1));
    if ((-30 - epsilon) <= p1 ) && (p1 <= (-30 + epsilon))
        z1 = 0;
        p1 = -30;
    else 
        z1 = 1;                    
    end
    n1=N1(x(i,column));
    mf1=Mf1(n1,p1,z1,x(i,column),sped_ref(column));
    tmp=mf1;
    if tmp<=t_vubm(i,column)
        z_opt(i,column)=z1;
        t_vubm(i,column)=tmp;
    end
end
%%
%逆推运算
% shift1 = column;
% shift = column;
for i=(column-1):-1:1 % 倒数第二列开始从后向前递推
    for j=1:row % 行的遍历
        if ~isnan(x(j,i))
            for k=1:row  % 从x(j,i)列到 x(:,i+1)列的每个state遍历
                b1=B1(x(j,i),x(k,i+1),a(i)); %制动
                p1=P1(x(j,i),x(k,i+1),a(i)); %驱动
                if ((-30 - epsilon) <= p1 ) && (p1 <= (-30 + epsilon))
                    z1 = 0;
                    p1 = -30;
                else 
                    z1 = 1;                    
                end
                if ((0<=p1)&&(p1<=120))||((0<=b1)&&(b1<=500))||(p1==-30)
                    n1=N1(x(j,i));
                    mf=Mf1(n1,p1,z1,x(j,i),sped_ref(i));
                    tmp=mf + f_opt(k,i+1) + alpha*abs(z1-z_opt(k,i+1));
%                     tmp=mf + f_opt(k,i+1);
                    if tmp<=t_vubm(j,i)
                        z_opt(j,i)=z1;
                        f_opt(j,i)=tmp;
                        x_opt(j,i)=x(k,i+1);
                        t_vubm(j,i)=tmp;
                    end
                end
            end
        end
    end
end
%%
X=x_opt;%该速度下对应的下一状态的最优速度
F=f_opt;
ZZZ=z_opt;%该速度下的最优档位
X_opt(1:column)=nan;
Z_opt(1:column)=nan;
X_opt(1)=x(1,1);%初始速度
X_opt(2)=X(1,1);%第二步速度
Z_opt(1)=ZZZ(1,1);%初始档位
%%
for i=2:(column-1)%从前向后依次寻找最优速度序列
    tmp2=x(:,i)-X_opt(i);
    tmp3=find(tmp2==0);
     X_opt(i+1)=X(tmp3,i);
end

for i=2:column%从前向后依次寻找最优档位序列
    tmp2=x(:,i)-X_opt(i);
    tmp3=find(tmp2==0);
    Z_opt(i)=ZZZ(tmp3,i);      
end

fval=f_opt(1,1);%最优成本
%%
for i=1:column-1%通过最优速度序列求解最优控制动作序列
    p(i)=P1(X_opt(i),X_opt(i+1),a(i));
    b(i)=B2(X_opt(i),X_opt(i+1),a(i),Z_opt(i));
    if p(i)>=0
        b(i)=0;
    else 
        p(i)=0;
    end
    if b(i) <= 0
        b(i) = 0;
    end
end
%%
mf_sum=0;%求解代价函数
for i=1:column-1
    n1=N1(X_opt(i));
    mf=Mf2(n1,p(i),Z_opt(i),X_opt(i));
    mf_sum=mf+mf_sum;
end
time_sum=0;%求解代价函数
for i=1:column-1
    time=h*3.6/X_opt(i);
    time_sum=time+time_sum;
end
